import React from 'react'
import Logo from '../../assets/Yogurt.svg'
import { Container } from './styles'

import SearchIcon from '@mui/icons-material/Search';
import ForumIcon from '@mui/icons-material/Forum';
import NotificationsActiveOutlinedIcon from '@mui/icons-material/NotificationsActiveOutlined';
import AccountCircleSharpIcon from '@mui/icons-material/AccountCircleSharp';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';

import ReactDOM from 'react-dom/client';
import { StyledEngineProvider } from '@mui/material/styles';
import Demo from '../SearchBar/searchBar';

ReactDOM.createRoot(document.querySelector("#root")).render(
  <StyledEngineProvider injectFirst>
    <Demo />
  </StyledEngineProvider>
);


const Header = () => {
  console.log(SearchIcon);
  return (


    <Container>
      <div className="header">

        <a href="#home">
          <img src={Logo} alt="Logo Yogurt" className="logo" />
        </a>
        <nav className="nav">
          <input type="text" className="inputSearch"></input>
            <a href="#search" className="searchLink">
              <SearchIcon fontSize="large" alt="search" className="SVG" id="searchSVG"></SearchIcon>
            </a>

            <a href="#messages" className="messageLink">
              <ForumIcon fontSize="large" alt="messages" className="SVG" id="messageSVG"></ForumIcon>
            </a>

            <a href="#notifications" className="notifyLink">
              <NotificationsActiveOutlinedIcon fontSize="large" alt="notifications" className="SVG" id="notifySVG"></NotificationsActiveOutlinedIcon>
            </a>

            <a href="#profile" className="userLink">
              <AccountCircleSharpIcon fontSize="large" alt="profile" className="SVG" id="userSVG"></AccountCircleSharpIcon>
            </a>

            <a href="#more" className="moreLink">
              <MoreHorizIcon fontSize="large" alt="more" className="SVG" id="moreSVG"></MoreHorizIcon>
            </a>

        </nav>
      </div>
    </Container>
  )
}
export default Header
